import React from "react";
import "./login.css";

function Login() {
  return (
    <div className="login">
      <div className="loginWrapper">
        <div className="loginLeft">
          <h3 className="loginLogo">Heyy Social</h3>
          <span className="loginDesc">
            Connect with friends and the world around you on Heyy Social
          </span>
        </div>
        <div className="loginRight">
          <div className="loginBox"></div>
        </div>
      </div>
    </div>
  );
}

export default Login;
